import React from "react";
import State from "./State";
import GasZTRPrice from "./GasZTRPrice";
import DaysMowedPerWeek from "./DaysMowedPerWeek";
import NumberNGBRUnits from "./NumberNGBRUnits";
import MowingHours from "./MowingHours";
import LengthMowingSeason from "./LengthMowingSeason";

const Inputs = ({
  setPADDRegion,
  customerInputs,
  handleChange,
  handleClick,
  buttonClick,
}) => {
  return (
    <div className="main container-inputs">
      <ul className="inputs" id="inputs">
        <li className="column states">
          <State
            {...{ customerInputs, handleChange, setPADDRegion, edit: 0 }}
          />
        </li>
        <li className="column range with-output">
          <GasZTRPrice {...{ customerInputs, handleChange, edit: 0 }} />
        </li>
        <li className="column range">
          <DaysMowedPerWeek
            {...{ customerInputs, handleChange, handleClick, edit: 0 }}
          />
        </li>
        <li className="column range">
          <NumberNGBRUnits
            {...{ customerInputs, handleChange, handleClick, edit: 1 }}
          />
        </li>
        <li className="column">
          <MowingHours
            {...{ customerInputs, handleChange, buttonClick, edit: 1 }}
          />
        </li>
        <li className="column range">
          <LengthMowingSeason
            {...{ customerInputs, handleChange, handleClick, edit: 1 }}
          />
        </li>
      </ul>
    </div>
  );
};

export default Inputs;
